import React from "react";
import "./headerDate.css";
function HeaderDate() {
  return (
    <div className="header__date">
      <div>
        <div className="header__date-day">12</div>
        <div>
          <div className="header__date-month">JAN</div>
          <div className="header__date-year">2016</div>
        </div>
      </div>
      <div className="header__weekday">TUESDAY</div>
    </div>
  );
}

export default HeaderDate;
